import React from "react";
const CatalogList = ({ items }) => {
  return (
    <>
      {items.map(item => (
        <CatalogItem key={item.id} item={item} />
      ))}
    </>
  );
};


const CatalogItem = ({ item }) => {
  return (
    <div class="catalog__col">
      <div class="catalog__card card">
        <div class="card__image">
          <img
src={require(`../../assets/Productos/${item.imageFileName}`).default} alt={item.name}
          />
        </div>
        <div class="card__body">
          <div class="card__title">{item.name}</div>
          <div class="shopline"></div>
          <div class="card__text">
          <p dangerouslySetInnerHTML={{ __html: item.description }} />
          </div>
          <div class="card__bottom">
            <div class="card__cost">{item.price}</div>
            <div class="card__button button">
              <a
                href="https://api.whatsapp.com/send?phone=+56936681029&text=Hola
        %2C%20quiero%20comprar%20un%20PC%20con%20las%20siguientes%20caracterÃ­stica
        %3A%0A%0A-PRIME H510M-E LGA 1200
        %20%0A-INTEL CORE I5-10400F LGA 1200
        %20%0A-RAM FURY BEAST 8GB DDR4 3200
        %20%0A-500GB SSD 3500MB/s
        %20%0A-Grafica a elegir"
              >
                Solicitar
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CatalogItem;
